import styled from "styled-components";


export const Wrapper = styled.div `
	display:flex;
	font-size: 1em;
	height: 100vh;
	width: 100vw;
	text-align: center;

`;

export const Content = styled.div `
	display: flex;
	flex-direction: row;
	justify-content: flex-start;
	margin: auto;
	width: 100%;
	height: 100%;
	background-color: #3776ab;
	padding-top:2em;

`;

export const WelcomeMessage = styled.div `
	flex: 1;
	width: 30px;
	height: 10%;
`;
